ポルトガル語で「光と影」を意味する「ルースイソンブラ」、kemari87限定の半袖プラクティスシャツ、プラクティスパンツの上下セット。<br>
ネイビーをベースにポップな切替カラーを採用し、カッコよさと可愛さを兼ね備えたデザイン。<br>
背中のルースロゴは今までの商品にほとんど使われていないマークを採用。
<br>親目線で子供に着せたいと思えるような商品をイメージ。<br>
